INSERT INTO Genres (GenreID, GenreName, Description) VALUES (1, 'Aksiyon', 'Yüksek enerjili ve çok sayıda hareket sahnesi içerir.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (2, 'Komedi', 'Hafif ve eğlenceli, mizahi içerikli filmler.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (3, 'Dram', 'Duygusal yoğunluk ve karakter odaklı hikayeler.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (4, 'Korku', 'Korkutucu ve gerilim dolu sahneler içerir.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (5, 'Bilim Kurgu', 'Geleceğe dair teknoloji ve uzay temaları.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (6, 'Romantik', 'Aşk ve ilişkiler üzerine odaklanır.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (7, 'Gerilim', 'Heyecan verici ve gerilim dolu olaylar.');
INSERT INTO Genres (GenreID, GenreName, Description) VALUES (8, 'Belgesel', 'Gerçek olayları ve bilgileri anlatan yapımlar.');
