INSERT INTO Genres (GenreID, GenreName, Description) VALUES (10, 'Fantastik', 'Büyü, doğaüstü ve hayali dünyalar içerir.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (1, 'Andrea', 'Esposito', 'Erkek', '1964-09-03', 'İtalya', 4, 'Seslendirme ve dublajda da başarılı çalışmaları vardır. Çok yönlü sanatçı kimliği ile tanınır. Toplumsal meselelere duyarlı projelerde yer almıştır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (2, 'Emily', 'Jones', 'Kadın', '1942-11-07', 'İngiltere', 6, 'Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Toplumsal meselelere duyarlı projelerde yer almıştır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (3, 'Manon', 'Leroy', 'Kadın', '1977-08-20', 'Fransa', 18, 'Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Film müziklerine özel önem verir ve işbirlikleri yapar. Uluslararası festivallerde aldığı ödüllerle adından söz ettirdi. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Derin karakter analizleri ile tanınmaktadır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (4, 'William', 'Johnson', 'Erkek', '1959-04-26', 'ABD', 2, 'Kariyerine genç yaşta başladı ve birçok başarılı projeye imza attı. Film endüstrisinde yenilikçi tekniklerle öncü olmuştur. Çok yönlü sanatçı kimliği ile tanınır. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (5, 'Verónica', 'García', 'Kadın', '1951-03-14', 'Meksika', 17, 'Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Film endüstrisinde yenilikçi tekniklerle öncü olmuştur. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Yaratıcı yönetmenlik anlayışı ve detaycılığı ile bilinir.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (6, 'Miguel', 'García', 'Erkek', '1960-06-11', 'Meksika', 7, 'Kültürel çeşitliliği ve insan hikayelerini işler. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Her filmi büyük bir titizlikle yönetir.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (7, 'Anna', 'Romano', 'Kadın', '1954-08-04', 'İtalya', 6, 'Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Seslendirme ve dublajda da başarılı çalışmaları vardır. Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (8, 'Giovanni', 'Ricci', 'Erkek', '1961-12-17', 'İtalya', 12, 'Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Toplumsal meselelere duyarlı projelerde yer almıştır. Drama ve komedi türlerinde ustalığını kanıtlamıştır. Seslendirme ve dublajda da başarılı çalışmaları vardır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (9, 'Linda', 'Smith', 'Kadın', '1945-01-06', 'ABD', 10, 'Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Yaratıcı yönetmenlik anlayışı ve detaycılığı ile bilinir. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Sektörde saygın bir isim olup birçok genç yeteneğe ilham vermiştir. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (10, 'Martina', 'Bianchi', 'Kadın', '1981-03-01', 'İtalya', 4, 'Çok yönlü sanatçı kimliği ile tanınır. Toplumsal meselelere duyarlı projelerde yer almıştır. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (11, 'Divya', 'Kumar', 'Kadın', '1975-10-31', 'Hindistan', 4, 'Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi. Kariyerine genç yaşta başladı ve birçok başarılı projeye imza attı. Sanat hayatında yenilikçi ve cesur çalışmalarıyla tanınır. Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır. Uluslararası festivallerde aldığı ödüllerle adından söz ettirdi.');
