INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (44, 'Federica', 'Greco', 'Kadın', '1955-08-12', 'İtalya', 9, 'Toplumsal meselelere duyarlı projelerde yer almıştır. Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Hayatı boyunca pek çok farklı rolde başarılı performanslar sergiledi. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Yaratıcı yönetmenlik anlayışı ve detaycılığı ile bilinir. Derin karakter analizleri ile tanınmaktadır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (45, 'Lucia', 'Diaz', 'Kadın', '1968-11-28', 'İspanya', 14, 'Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır. Doğal oyunculuğu ve sahne hakimiyetiyle izleyiciyi büyüler. Çok yönlü sanatçı kimliği ile tanınır. Uluslararası festivallerde aldığı ödüllerle adından söz ettirdi.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (46, 'Marco', 'Esposito', 'Erkek', '1970-01-26', 'İtalya', 9, 'Yaratıcı yönetmenlik anlayışı ve detaycılığı ile bilinir. Sanat hayatında yenilikçi ve cesur çalışmalarıyla tanınır. Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (47, 'Léna', 'Durand', 'Diğer', '1946-07-14', 'Fransa', 20, 'Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Kültürel çeşitliliği ve insan hikayelerini işler. Doğal oyunculuğu ve sahne hakimiyetiyle izleyiciyi büyüler. Drama ve komedi türlerinde ustalığını kanıtlamıştır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (48, 'Aylin', 'Aydın', 'Kadın', '1940-06-30', 'Türkiye', 7, 'Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır. Her filmi büyük bir titizlikle yönetir. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (49, 'Jun', 'Zhang', 'Erkek', '1950-11-20', 'Çin', 14, 'Film müziklerine özel önem verir ve işbirlikleri yapar. Her filmi büyük bir titizlikle yönetir. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Çok yönlü sanatçı kimliği ile tanınır. Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır.');
INSERT INTO Directors (DirectorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (50, 'Neha', 'Reddy', 'Kadın', '1980-01-02', 'Hindistan', 14, 'Film müziklerine özel önem verir ve işbirlikleri yapar. Drama ve komedi türlerinde ustalığını kanıtlamıştır. Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır.');
