INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (8, 'Alejandro', 'López', 'Erkek', '1993-04-15', 'Meksika', 7, 'Kültürel çeşitliliği ve insan hikayelerini işler. Yaratıcı yönetmenlik anlayışı ve detaycılığı ile bilinir. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (9, 'Carmen', 'Sánchez', 'Kadın', '1956-04-06', 'Meksika', 5, 'Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Hayatı boyunca pek çok farklı rolde başarılı performanslar sergiledi. Çok yönlü sanatçı kimliği ile tanınır. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Seslendirme ve dublajda da başarılı çalışmaları vardır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (10, 'Yu-Jin', 'Yoon', 'Kadın', '1990-01-23', 'Güney Kore', 5, 'Toplumsal meselelere duyarlı projelerde yer almıştır. Film müziklerine özel önem verir ve işbirlikleri yapar. Kültürel çeşitliliği ve insan hikayelerini işler. Her filmi büyük bir titizlikle yönetir. Sektörde saygın bir isim olup birçok genç yeteneğe ilham vermiştir.');
