INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (220, 'Ella', 'Smith', 'Kadın', '1960-09-17', 'İngiltere', 2, 'Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi. Kültürel çeşitliliği ve insan hikayelerini işler. Filmografisi geniş ve farklı türlerde eserleri bulunmakta.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (221, 'Seo-Yeon', 'Lee', 'Kadın', '1977-11-15', 'Güney Kore', 8, 'Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Film endüstrisinde yenilikçi tekniklerle öncü olmuştur. Yaratıcı yönetmenlik anlayışı ve detaycılığı ile bilinir. Hayatı boyunca pek çok farklı rolde başarılı performanslar sergiledi. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Seslendirme ve dublajda da başarılı çalışmaları vardır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (222, 'Ana', 'Flores', 'Kadın', '1991-08-15', 'Meksika', 7, 'Çok yönlü sanatçı kimliği ile tanınır. Toplumsal meselelere duyarlı projelerde yer almıştır. Film müziklerine özel önem verir ve işbirlikleri yapar. Drama ve komedi türlerinde ustalığını kanıtlamıştır.');
