INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (262, 'Sunita', 'Reddy', 'Kadın', '1974-10-12', 'Hindistan', 0, 'Kariyerine genç yaşta başladı ve birçok başarılı projeye imza attı. Derin karakter analizleri ile tanınmaktadır. Sanat hayatında yenilikçi ve cesur çalışmalarıyla tanınır. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (263, 'Carmen', 'Moreno', 'Kadın', '1958-12-28', 'İspanya', 1, 'Toplumsal meselelere duyarlı projelerde yer almıştır. Film endüstrisinde yenilikçi tekniklerle öncü olmuştur. Derin karakter analizleri ile tanınmaktadır. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Kültürel çeşitliliği ve insan hikayelerini işler.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (264, 'Giulia', 'Ferrari', 'Kadın', '1992-06-09', 'İtalya', 4, 'Sanat hayatında yenilikçi ve cesur çalışmalarıyla tanınır. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Çok yönlü sanatçı kimliği ile tanınır. Seslendirme ve dublajda da başarılı çalışmaları vardır. Kültürel çeşitliliği ve insan hikayelerini işler. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (265, 'Sanya', 'Sharma', 'Kadın', '1979-09-28', 'Hindistan', 7, 'Film endüstrisinde yenilikçi tekniklerle öncü olmuştur. Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Sektörde saygın bir isim olup birçok genç yeteneğe ilham vermiştir. Hayatı boyunca pek çok farklı rolde başarılı performanslar sergiledi. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir.');
