INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (267, 'Ethan', 'Moreau', 'Erkek', '1986-07-13', 'Fransa', 5, 'Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır. Uluslararası festivallerde aldığı ödüllerle adından söz ettirdi. Filmografisi geniş ve farklı türlerde eserleri bulunmakta.');
