INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (303, 'Xiu', 'Li', 'Kadın', '1994-06-26', 'Çin', 7, 'Drama ve komedi türlerinde ustalığını kanıtlamıştır. Sektörde saygın bir isim olup birçok genç yeteneğe ilham vermiştir. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi. Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (304, 'Alice', 'Petit', 'Kadın', '1983-12-21', 'Fransa', 1, 'Her filmi büyük bir titizlikle yönetir. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Film müziklerine özel önem verir ve işbirlikleri yapar. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Doğal oyunculuğu ve sahne hakimiyetiyle izleyiciyi büyüler. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (305, 'Michael', 'Johnson', 'Erkek', '1994-08-15', 'ABD', 6, 'Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi. Toplumsal meselelere duyarlı projelerde yer almıştır. Çok yönlü sanatçı kimliği ile tanınır. Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur.');
