INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (392, 'Anjali', 'Patel', 'Kadın', '1986-04-25', 'Hindistan', 2, 'Drama ve komedi türlerinde ustalığını kanıtlamıştır. Sektörde saygın bir isim olup birçok genç yeteneğe ilham vermiştir. Duygusal yoğunluğu yüksek performanslarıyla övgü toplamıştır. Hayatı boyunca pek çok farklı rolde başarılı performanslar sergiledi. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (393, 'Anna', 'Becker', 'Kadın', '1985-06-24', 'Almanya', 5, 'Derin karakter analizleri ile tanınmaktadır. Uluslararası festivallerde aldığı ödüllerle adından söz ettirdi. Çok yönlü sanatçı kimliği ile tanınır. Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Sanat hayatında yenilikçi ve cesur çalışmalarıyla tanınır. Drama ve komedi türlerinde ustalığını kanıtlamıştır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (394, 'Andrea', 'Ferrari', 'Erkek', '1957-03-08', 'İtalya', 6, 'Kariyerine genç yaşta başladı ve birçok başarılı projeye imza attı. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Doğal oyunculuğu ve sahne hakimiyetiyle izleyiciyi büyüler.');
