INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (396, 'Tim', 'Schneider', 'Erkek', '1975-06-30', 'Almanya', 2, 'Uzun yıllar sinema sektöründe önemli projelerde yer aldı. Çeşitli ödüllere layık görüldü ve eleştirmenlerce beğenildi. Seslendirme ve dublajda da başarılı çalışmaları vardır. Film endüstrisinde yenilikçi tekniklerle öncü olmuştur.');
