INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (434, 'Emre', 'Yılmaz', 'Erkek', '1969-10-23', 'Türkiye', 10, 'Her filmi büyük bir titizlikle yönetir. Çalışmaları pek çok genç sinemacıya ilham kaynağı olmuştur. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Çekimleri zorlu coğrafyalarda gerçekleştiren deneyimli bir sanatçıdır. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Drama ve komedi türlerinde ustalığını kanıtlamıştır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (435, 'Karan', 'Gupta', 'Erkek', '1985-05-18', 'Hindistan', 5, 'Doğal oyunculuğu ve sahne hakimiyetiyle izleyiciyi büyüler. Klasik ve modern sinemayı harmanlayan özgün bir yönetmendir. Çok yönlü sanatçı kimliği ile tanınır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (436, 'Sakura', 'Ito', 'Kadın', '1973-07-22', 'Japonya', 8, 'Film müziklerine özel önem verir ve işbirlikleri yapar. Sinema ve tiyatro arasında başarılı bir geçiş yapmıştır. Sanat hayatında yenilikçi ve cesur çalışmalarıyla tanınır. Çok yönlü sanatçı kimliği ile tanınır. Doğal oyunculuğu ve sahne hakimiyetiyle izleyiciyi büyüler. Toplumsal meselelere duyarlı projelerde yer almıştır.');
INSERT INTO Actors (ActorID, FirstName, LastName, Gender, BirthDate, Nationality, AwardsCount, Biography) VALUES (437, 'Inès', 'Simon', 'Kadın', '1967-08-05', 'Fransa', 8, 'Drama ve komedi türlerinde ustalığını kanıtlamıştır. Filmografisi geniş ve farklı türlerde eserleri bulunmakta. Sanat ve kültür dünyasında önemli bir figür olarak kabul edilir. Film müziklerine özel önem verir ve işbirlikleri yapar.');
